-- END DROPS


-- Table Creation --
CREATE TABLE AcadPeriods
(
    AcadPeriodID INT PRIMARY KEY IDENTITY(1, 1),
	AcadPeriodName VARCHAR(15),
    SemYear CHAR(4),
	Semester VARCHAR(50),
	StartDate DATE,
	EndDate DATE
)
GO
-- CREATE AcadPeriods END

CREATE TABLE Buildings
(
    BuildingID INT PRIMARY KEY IDENTITY(1, 1),
    BuildingName VARCHAR(20)
)
GO
-- CREATE Buildings END

CREATE TABLE Rooms
(
	RoomID INT PRIMARY KEY IDENTITY(1, 1),
	RoomNum VARCHAR(10)
)

CREATE TABLE Departments
(
    DepartmentID INT PRIMARY KEY IDENTITY(1, 1),
    Department CHAR(4),
    DepartmentDesc VARCHAR(35)
)
GO
-- CREATE Departments END

CREATE TABLE Professors
(
	ProfessorID INT PRIMARY KEY IDENTITY(1,1) NOT NULL,
	ProfessorFullName VARCHAR(100) NULL,
	ProfessorFName VARCHAR(50) NULL,
	ProfessorMInitial VARCHAR(2) NULL,
	ProfessorLName VARCHAR(50) NULL,
	ProfessorEmail VARCHAR(50) NULL,
	NULLHolder CHAR(4) NULL,
)
GO
-- CREATE Professors END

CREATE TABLE Subjects
(
    SubjectID INT PRIMARY KEY IDENTITY(1, 1),
    SubjectAbbr CHAR(4) NOT NULL,
    SubjectName VARCHAR(40) NOT NULL,
	DepartmentID INT

	FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID)
)
-- CREATE Subjects END

CREATE TABLE Grades
(
    GradeID INT PRIMARY KEY IDENTITY(1, 1),
    Grade VARCHAR(11) NOT NULL,
	Points FLOAT
)
-- CREATE Grades END

CREATE TABLE ScheduleTypes
(
    ScheduleTypeID INT PRIMARY KEY IDENTITY(1, 1),
    ScheduleTypeName VARCHAR(30)
)
-- CREATE ScheduleTypes END

CREATE TABLE Majors
(
    MajorID INT PRIMARY KEY IDENTITY(1, 1),
    MajorName VARCHAR(32) NOT NULL,
	DepartmentID INT

	FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID)
)
-- CREATE Majors END

CREATE TABLE Students
(
    StudentID INT PRIMARY KEY IDENTITY(1, 1),
	MajorID INT,
	StudentName VARCHAR(30) NOT NULL,
    StudentFName VARCHAR(20) NOT NULL,
	StudentMName VARCHAR(20) ,
    StudentLName VARCHAR(50) NOT NULL,
	StudentYear INT,
	StudentGPANum DECIMAL(4,2),
	StudentGPALetter VARCHAR(2)

    FOREIGN KEY (MajorID) REFERENCES Majors(MajorID)
)
-- CREATE Students END

CREATE TABLE Programs
(
    ProgramID INT PRIMARY KEY IDENTITY(1, 1),
    ProgramName VARCHAR(30),
    CIPCode CHAR(6)
)
GO
-- CREATE Programs END

CREATE TABLE Courses
(
	CourseID INT PRIMARY KEY IDENTITY(1, 1),
	CourseLabel VARCHAR(15),
	CourseNumber VARCHAR(10),
	SubjectID INT,
	ProgramID INT,
	DepartmentID INT,
	MinimumCredit INT,
	MaximumCredit NVARCHAR(20),
	CourseDescription VARCHAR(MAX),
	Title NVARCHAR(500),

	FOREIGN KEY (SubjectID) REFERENCES Subjects(SubjectID),
	FOREIGN KEY (ProgramID) REFERENCES Programs(ProgramID),
	FOREIGN KEY (DepartmentID) REFERENCES Departments(DepartmentID),
)
GO

--CREATE TABLE Courses END

CREATE TABLE CourseOfferings
(
	CourseOfferingID INT PRIMARY KEY IDENTITY(1, 1),
	AcadPeriodID INT,
	CourseID INT,
	ProfessorID INT,
	BuildingID INT,
	RoomID INT,
	Time VARCHAR(30),
	Days VARCHAR(20),
	CRN VARCHAR(6),
	Section VARCHAR(10),
	MaximumEnrollment INT,
	NULLHolder INT,

	FOREIGN KEY (AcadPeriodID) REFERENCES AcadPeriods(AcadPeriodID),
	FOREIGN KEY (CourseID) REFERENCES Courses(CourseID),
	FOREIGN KEY (ProfessorID) REFERENCES Professors(ProfessorID),
	FOREIGN KEY (BuildingID) REFERENCES Buildings(BuildingID),
	FOREIGN KEY (RoomID) REFERENCES Rooms(RoomID)
)
GO
--CREATE CourseOfferings END

CREATE TABLE StudentMajors
(
	StudentMajorID INT PRIMARY KEY IDENTITY(1, 1),
	StudentID INT,
	MajorID INT,
	StartYear INT,
	EndYear INT

	FOREIGN KEY (StudentID) REFERENCES Students(StudentID),
	FOREIGN KEY (MajorID) REFERENCES Majors(MajorID),
)
--CREATE StudentsToPrevMajors END

CREATE TABLE StudentAdvising 
(
	StudentAdvisingID INT PRIMARY KEY IDENTITY(1, 1),
	StudentID INT,
	ProfessorID INT,

	FOREIGN KEY (StudentID) REFERENCES Students(StudentID),
	FOREIGN KEY (ProfessorID) REFERENCES Professors(ProfessorID),
	--Employee ID needs to be AdvisorID in this table, the y are te same thing but need to be visually different
)
--CREATE StudentAdvising END

CREATE TABLE StudentEnrollment 
(
	StudentEnrollmentID INT PRIMARY KEY IDENTITY(1, 1),
	StudentID INT,
	CourseOfferingID INT,
	GradeID INT,
	ActualCreditHours INT

	FOREIGN KEY (StudentID) REFERENCES Students(StudentID),
	FOREIGN KEY (CourseOfferingID) REFERENCES CourseOfferings(CourseOfferingID),
	FOREIGN KEY (GradeID) REFERENCES Grades(GradeID),

)
GO
--CREATE StudentEnrollment END

CREATE TABLE Advisors
(
	AdvisorID INT PRIMARY KEY IDENTITY(1, 1),
	ProfessorID INT,
	AdvisorFName VARCHAR(30), 
	AdvisorLName VARCHAR(30),
	AdvisorEmail VARCHAR(50),


	FOREIGN KEY (ProfessorID) REFERENCES Professors(ProfessorID)
)
--CREATE Advisors END

CREATE TABLE OrderedAcadPeriods
(
	OrderedPeriodID INT PRIMARY KEY IDENTITY(1, 1),
	AcadPeriodID INT,

	FOREIGN KEY (AcadPeriodID) REFERENCES AcadPeriods(AcadPeriodID)
)



