		(1163,N'EDCIB599',N'B599',17,46,8,1,N'3',N'(Prerequisite: Permission of Instructor) Introduction to topics in education. Course content varies and will be determined by instructor.',N'Special Topics in Education'),
		(1164,N'CSCIB601',N'B601',14,33,6,3,N'NULL',N'Prerequisite: CSCI B201 [or demonstrated equivalent knowledge/experience] or consent of instructor) Principles and practices of computer systemsecurity including operating system security, network security, software security and web security.',N'Principles of Computer Securit'),
		(1165,N'EDRDB619',N'B619',25,53,8,3,N'NULL',N'(Prerequisite: Permission of Department) This course provides candidates with comprehensive knowledge of the social, cultural, and linguistic factorsthat influence reading development. Emphasis is placed on practical application of theory, oral language development, phonemic awareness andphonics.',N'Foundations of Reading'),
		(1166,N'EDRMB620',N'B620',26,46,8,3,N'NULL',N'This course provides an overview of the principles, models, and techniques of educational research. A substantial portion of this course focuses on the acquisition of critical reading skills and on the analysis and interpretation of data produced by educational investigation and inquiry.',N'Educ Research, Design & Analy'),
		(1167,N'CSCIB622',N'B622',14,33,6,3,N'NULL',N'(Prerequisite: CSCI B520 [or demonstrated equivalent knowledge/experience] or consent of instructor) Foundations of data analytics. Concepts andskills for relational data modeling, querying, and management.',N'Data Management & Analytics'),
		(1168,N'EDRDB623',N'B623',25,53,8,3,N'NULL',N'This course requires that students conduct in-depth study of effective literacy methods, materials, and formative assessment for K-12 classrooms. Emphasis is on serving the instructional needs of diverse students, including the gifted and talented, culturally and linguistically diverse learners, and children and young people with disabilities.',N'Differentiation in Read Instr'),
		(1169,N'EDRDB624',N'B624',25,53,8,3,N'NULL',N'(Prerequisite: Department Permission) This course focuses on determining reading and language needs of English learners through the use of screening and diagnostic assessments and using that information to inform teaching of English learners within the classroom setting. Candidates learn to administer quick assessments and design instruction and how instruction varies and students acquire language. Candidates choose one student''s data to present in a case study format. ',N'Assessment & Instructional'),
		(1170,N'EDRDB625',N'B625',25,53,8,3,N'NULL',N'Teachers will examine various types of assessments that will determine students strengths and areas for further instruction. Teachers will analyze existing data from multiple levels: individual students, groups of students (class level), grade levels, school, district, state, and national level data. They will explain assessment results and demonstrate the ability to advocate for appropriate literacy practices to relevant stakeholders. Teachers will also be able to locate and administer non-biased assessments to culturally and linguistically diverse student. This course aligns with Read to Succeed Legislation requirements for in-service teachers.',N'Assessment Strategies for Read'),
		(1171,N'EDRDB626',N'B626',25,55,8,3,N'NULL',N'This course is designed to instruct graduate candidates, grades k-12 in developing methods and materials that will improve their students literacy skills in the content areas of math, social studies, science, and health. Emphasis is on the application of strategies that will support students in reading, writing, and working with media in the context of content area instruction.',N'Writing Across the Curriculum'),
		(1172,N'EDRDB629',N'B629',25,53,8,3,N'NULL',N'After gaining a sound theoretical knowledge of the reading and writing processes in nonfiction text, teachers will apply what they have learned to their own disciplines, creating strategies that will support students in reading and writing within the context of content area instruction.',N'Content Area Reading & Writing'),
		(1173,N'EDRDB632',N'B632',25,53,8,3,N'NULL',N'Candidates will gain skills necessary for conducting action research in literacy education and coaching.  This includes assessing the needs of teacher/students, identifying research-based interventions, designing and implementing a coaching plan including identification of assessment to document effectiveness of plan, and assessing effectiveness of coaching plan.',N'Action Research for Lit Edu'),
		(1174,N'EDPYB635',N'B635',24,50,8,3,N'NULL',N'(Prerequisite: Permission of Department) This course will introduce and illustrate the proper use of learning theories in providing insights into definingand solving problems that may be encountered in educational settings. The emphasis will be on the use of these theories to solve realistic and relevant problems drawn from the classroom teachers own personal experience or from cases in the readings.',N'Advanced Educational Psych'),
		(1175,N'EDRDB640P',N'B640P',25,53,8,3,N'NULL',N'(Prerequisite: Department Permission) Supervised clinical experience in literacy that is implemented within the classroom. Candidates will practice proficiency in planning, assessing, and teaching using various methods of reading and writing that serve the needs of English Language Learners. The main assessment for this course is a diagnostic reading case study.',N'Practicum in Assessing & Teach'),
		(1176,N'EDRDB645',N'B645',25,56,8,3,N'NULL',N'Candidates will gain the skills to create, manage and evaluate school-wide reading programs. This includes learning adult learning theories, developing professional learning opportunities, and supervising the literacy program.',N'Action Research for Literacy'),
		(1177,N'EDRDB650',N'B650',25,56,8,3,N'NULL',N'This course is the culmination of the M.Ed. program and focuses on bringing together all of the South Carolina Literacy Competencies for Reading Coaches (SCDE, 2015). Candidates discuss presentations by various literacy specialists and exemplary literacy coaches, evaluate a variety of literacy programs, materials, and assessments, and prepare a professional portfolio. ',N'Capstone: Literacy Coaching'),
		(1178,N'CSCIB699',N'B699',14,33,6,1,N'3',N'Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator.',N'Industrial/Research Internship'),
		(1179,N'CSCIB797',N'B797',14,33,6,3,N'6',N'Research in Computational Science. Repeatable as needed, with approval from the Computer Science department chair.',N'Research Project'),
		(1180,N'CSCIB799',N'B799',14,33,6,3,N'6',N'Preparation of a thesis for the master''s degree. Repeatable as needed, with approval from the Computer Science department chair.',N'Master''s Thesis');
	INSERT INTO [Courses]
