		VALUES (N'1181',N'CSCIB499',N'B499',14,6,27,1,3,N'(Prerequisite: [CSCI/ISAT Majors only] and Consent of instructor) Practical work experience in an area of Computer Science or IT, selected by the student and approved by the Computer Science Department Chair or ISAT Program Coordinator. For 1 credit, 45 minimum internship work hours are typically required; for 2 credits, 90 work hours; and for 3 credits, 135 work hours. ',N'Comp Science Co-op/Internship'),
		(N'1182',N'ISATB499',N'B499',42,6,27,1,3,N'(Prerequisite: [CSCI/ISAT Majors only] and consent of instructor) Practical work experience in an area of Computer Science or IT, selected by the student and approved by the Computer Science Department Chair or ISAT Program Coordinator. For 1 credit, 45 minimum internship work hours are typically required; for 2 credits, 90 work hours; and for 3 credits, 135 work hours. ',N'Comp Science Co-Op/Internship');
