		(1185,N'PSYCB331',N'B331',59,2,106,3,NULL,N'Social Psychology',N'(Prerequisite: PSYC B101) Introduction to theory and research in social psychology from a psychological viewpoint. Topics include social perception,social cognition, attitudes, interpersonal relationships, aggression, prosocial behavior and group processes.');
